INSERT INTO `gauchadas` (`id_gauchada`, `idusuario`, `idcategoria`, `idciudad`, `titulo`, `descripcion`, `foto`, `extension`, `postulantes`) VALUES
(1, 1, 2, 1, 'Busco acompañante de viaje', 'Soy camionero y busco una persona que me acompañe en mi viaje hasta Rawson porque sufro problemas de sueño. \r\nSaldríamos el primer fin de semana de octubre y retornaríamos el fin de semana siguiente. \r\n* Condición fundamental: debe cebar buenos mates', , 'image/png', 1);
INSERT INTO `gauchadas` (`id_gauchada`, `idusuario`, `idcategoria`, `idciudad`, `titulo`, `descripcion`, `foto`, `extension`, `postulantes`) VALUES
(2, 2, 3, 2, 'Reencontrarme con Ramirez', 'Ramirez es un burrito que tenía de mascota en un campo en Tucumán. Quisiera reencontrarme con él pero no puedo moverme por un problema físico. \r\nMe gustaría que alguien lo traiga desde mi pueblo para poder saludarlo y luego volver a llevarlo.\r\n*la foto es del 2004, Ramirez puede haber cambiado un poco', , 'image/jpg', 0);
INSERT INTO `gauchadas` (`id_gauchada`, `idusuario`, `idcategoria`, `idciudad`, `titulo`, `descripcion`, `foto`, `extension`, `postulantes`) VALUES
(3, 2, 3, 1, 'Busco testigo falso', 'El año pasado tuve un accidente automovilístico en el que choqué el frente de una casa. El dueño de esa casa me quiere llevar a juicio y estoy buscando evitarlo.\r\nNecesito de un/a abuelito/a que testifique a mi favor diciendo que choqué el frente de la casa por esquivarlo/a.', , 'image/png', 3);
INSERT INTO `gauchadas` (`id_gauchada`, `idusuario`, `idcategoria`, `idciudad`, `titulo`, `descripcion`, `foto`, `extension`, `postulantes`) VALUES
(4, 1, 3, 1, 'Karl', 'Karl es mi perrito y necesita de alguien que lo cuide durante la primera quincena de enero que me voy de vacaciones.\r\nEs muy juguetón y muy buena compañía.', , 'image/jpg', 10);
INSERT INTO `gauchadas` (`id_gauchada`, `idusuario`, `idcategoria`, `idciudad`, `titulo`, `descripcion`, `foto`, `extension`, `postulantes`) VALUES
(5, 1, 1, 2, 'Restaurar obra de arte', 'La imagen de la izquierda es la original y la de la derecha mi intento por restaurarla. ¿Alguien me haría la gauchada de acomodarla para que se parezca más a la original? ', , 'image/jpg', 0);

